package javaFundamentals;

public class Array4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int nums[] = {96,97,98,99,68,69,40,1};
		System.out.print("[");
		for(int i=0;i<nums.length;i++) {
			System.out.print((char)(nums[i])+" ");
		}
		System.out.print("]");
	}

}
